package com.shashi;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i=10;
		switch(i)
		{
		case 5:
		System.out.println("Five");
		break;
		case 10:
		System.out.println("Ten");
		break;
		case 15:
		System.out.println("Fifteen");
		break;
		case 20:
		System.out.println("Twenty");
		break;
		default:
		System.out.println("Default");
		break;
		}


	}

}
